import { style } from "typestyle";

const MembershipCardStyle = style({
    // position: 'absolute',
    display: 'flex',
    justifyContent: 'space-between',
    flexDirection: 'column',
    alignItems: 'center',
    paddingTop: '150px',
    boxSizing: 'border-box',
    height: '100%',
    width: '400px',
    borderRight: 'solid 5px red',
    background: 'white',
    color: 'black',
    textAlign: 'center',
    $nest: {
        '& .title': {
            fontFamily: 'GothamBold',
            fontSize: '32px',
            marginRight: '50%'
        }
    }
})

export default MembershipCardStyle
